Based on the 2026 documentation, here's how to store data locally using AsyncStorage in Expo SDK 54:

## Installation

For Expo projects (including SDK 54):

```bash
npx expo install @react-native-async-storage/async-storage
```

## Basic Usage

AsyncStorage provides an asynchronous, unencrypted, persistent, key-value storage API. Here are the main operations:

### Storing Data

```javascript
import AsyncStorage from '@react-native-async-storage/async-storage';

// Store string data
const storeData = async (value) => {
  try {
    await AsyncStorage.setItem('my-key', value);
  } catch (e) {
    // saving error
  }
};

// Store object data (must stringify)
const storeObject = async (value) => {
  try {
    const jsonValue = JSON.stringify(value);
    await AsyncStorage.setItem('my-key', jsonValue);
  } catch (e) {
    // saving error
  }
};
```

### Reading Data

```javascript
// Read string data
const getData = async () => {
  try {
    const value = await AsyncStorage.getItem('my-key');
    if (value !== null) {
      // value previously stored
      return value;
    }
  } catch (e) {
    // error reading value
  }
};

// Read object data (must parse)
const getObject = async () => {
  try {
    const jsonValue = await AsyncStorage.getItem('my-key');
    return jsonValue != null ? JSON.parse(jsonValue) : null;
  } catch (e) {
    // error reading value
  }
};
```

### Removing Data

```javascript
// Remove single item
const removeValue = async () => {
  try {
    await AsyncStorage.removeItem('my-key');
  } catch (e) {
    // remove error
  }
};

// Clear all data
const clearAll = async () => {
  try {
    await AsyncStorage.clear();
  } catch (e) {
    // clear error
  }
};
```

## Important Characteristics

- **Asynchronous**: All operations return Promises, use async/await
- **Unencrypted**: Data is stored in plain text (not secure for sensitive data)
- **Persistent**: Data survives app restarts
- **String-based**: Only stores strings, use JSON.stringify/parse for objects

## Platform Support

AsyncStorage (v2.2.0) works on:
- Android
- iOS
- macOS
- tvOS
- Web
- visionOS
- Windows

## Configuration (Android)

To increase storage limit from default 6MB, edit `android/gradle.properties`:

```properties
AsyncStorage_db_size_in_MB=10
```

## Best Practices

1. Always wrap operations in try-catch blocks
2. Use JSON.stringify() before storing objects
3. Use JSON.parse() after retrieving objects
4. Check for null values when reading data
5. Don't store sensitive data (passwords, tokens) without encryption

Sources:
- [@react-native-async-storage/async-storage - Expo Documentation](https://docs.expo.dev/versions/latest/sdk/async-storage/)
- [Expo SDK 54 - Expo Changelog](https://expo.dev/changelog/sdk-54)
- [GitHub - react-native-async-storage/async-storage](https://github.com/react-native-async-storage/async-storage)
- [Getting Started with React Native AsyncStorage](https://jscrambler.com/blog/how-to-use-react-native-asyncstorage)

